import React from 'react';
// import images from '../images/';

const experience_box= props =>(
<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">
  <div class="card " >
    <div class="card-body ">
<small class="float-right" style={{color: 'darkgray'}}>{props.experience.startDate} to {props.experience.endDate}</small>
        <h1 class="bold card-title">{props.experience.designation} </h1>
        <h2 class="card-title">{props.experience.firm} </h2>
        <p class="card-text">{props.experience.description}</p>

        {/* <button class="btn-primary ">Read more</button> */}

    </div>
  </div>
</div>



);

class Experience extends React.Component{
    constructor(props){
    super(props)
        this.state={

              experiences:[{designation:'name',description:'name',firm:'Null Innovation',startDate:'',endDate:''},
              {designation:'name',description:'name',firm:'Null Innovation',startDate:'',endDate:''}]
        }
    }

    experience_list(){
        return this.state.experiences.map(current =>{
            return <experience_box experience={current}  />;
        })
    }
    render(){
        return(
            <div className="container project_bg">
                <hr />
                <h1 className="text-center">Experience</h1>
                <div className="row">
                {this.experience_list() }
                </div>
                <br />
            </div>
        );
    }
}

export default Experience;
